INSERT INTO `99_offer_details_extn` VALUES (2,50621,1,'','','','0000-00-00','0000-00-00',100,0,0,'','','','','',0,'',0,'',0,'',0,'','','','','','',0,'2016-08-10','23.30.55.110','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.116 Safari/537.36','','','','','','','','','','<p class=\"p1\">North Capital Private Securities is a registered broker-dealer based in Salt Lake City.</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">Offering price: &nbsp;$000000</p>\n<p class=\"p1\">Price per unit: $10000</p>\n<p class=\"p1\">&nbsp;</p>','','',0,'245_245_1470845954.png','','','','','','','','<p class=\"p1\">Through our network of funding platforms and correspondent broker-dealers, NCPS can help you reach thousands of accredited investors including high net worth individuals, family offices, endowments, foundations, and other institutional investors.</p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\">*We extend your network with our network</p>\r\n<p class=\"p1\">*Syndicate your private offerings</p>\r\n<p class=\"p1\">*Syndicate your deal</p>\r\n<p class=\"p1\">*Gain access to thousands of accredited investors</p>','0','465_465_1470845954.png','http://northcapital.com/','','','<p class=\"p1\">We work with issuers to evaluate their prospective offering and provide advice regarding the structure, timing, and distribution channels for their placement. In addition, we can facilitate the preparation of marketing and offering materials, including pitch books, tear sheets, offering memoranda, and subscription agreements. We collaborate with our clients to develop strategies for investor servicing, to facilitate investor research, due diligence and ongoing reporting. Prior to accepting any placement mandate, NCPS conducts its own review and due diligence on each offering, including checks on key personnel and an operational review of the business. Our principals have conducted research and due diligence on hundreds of issuers over the past two decades, and we have been involved in raising hundreds of millions of dollars through private placements.</p>',1,'','<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/ywhcFo63IGk\" frameborder=\"0\" allowfullscreen></iframe>','<p class=\"p1\">The principals of North Capital have been helping individuals, families, corporations and institutional investors tackle their complex financial and investment problems for over twenty five years. North Capital\'s investment process is grounded in enduring principles: broad diversification, a systematic, open architecture approach to investment selection, low costs, and tax efficiency.</p>','245_245_1470845954.png'),(3,12045,1,'','','','0000-00-00','0000-00-00',1000,0,0,'','','','','',0,'',0,'',0,'',0,'','','','','','',0,'2016-08-16','23.30.55.110','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/52.0.2743.116 Safari/537.36','','','','','','','','','','<p class=\"p1\">MobilePineapple is a rapid, enterprise-grade mobile app development platform that does not require any coding.</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">Offering Price: $250,000.00</p>\n<p class=\"p1\">Price per Unit: $1,000.00</p>','','',0,'245_245_1471367725.jpg','','','','','','','','<p class=\"p1\">Using our platform, non-programmers in your organization can quickly turn their mobile ideas into custom, native apps, and test them immediately in action.</p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<ul class=\"ul1\">\r\n<li class=\"li1\">Prototype your custom app in a matter of hours.</li>\r\n<li class=\"li1\">Send a test app directly to your phone or iPad. No emulators &ndash; your focus group gets a full native user experience for testing and review.</li>\r\n<li class=\"li1\">Build natively for iOS and Android with one click, and submit directly to the app stores.</li>\r\n<li class=\"li1\">Manage your app throughout its lifecycle and update it on-the-fly.</li>\r\n<li class=\"li1\">Get started on mobile quickly &ndash; implement an agile methodology in all of your mobile app development projects.</li>\r\n</ul>','1','465_465_1471367725.png','http://northcapital.com/','','','<p class=\"p1\">MobilePineapple is an enterprise-class, flexible mobile app development platform that enables organizations to rapidly create, deploy, and manage CUSTOM, NATIVE apps for iPhone, iPad, and Android smartphones without writing a line of code.</p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<p class=\"p1\">We empower organizations to get to market quickly with unique self-built mobile apps that drive business value. Our clients create award-winning mobile apps, easily integrate their data sources, securely manage each mobile app from a dedicated online CMS, and take advantage of proximity-based push messaging via MobilePineapple integration.</p>',1,'','<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3115.7927636240024!2d-121.29456684878974!3d38.65364516877941!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x809ade71e925e4e7%3A0x848776db0a6199bf!2s4821+San+Juan+Ave%2C+Fair+Oaks%2C+CA+95628!5e0!3m2!1sen!2sus!4v1471469825380\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>\r\n','<p class=\"p1\">All of MobilePineapple&rsquo;s leaders have a strong background in technology. Our team has experience in a wide range of topics from development and information systems to government and healthcare.We have the skills to make your project a success!</p>','245_245_1471367725.jpg'),(5,22703,1,'','','','0000-00-00','0000-00-00',2100,0,0,'','','','','',0,'',0,'',0,'',0,'','','','','','',0,'2016-09-29','110.172.170.246','Mozilla/5.0 (Windows NT 10.0; WOW64; rv:49.0) Gecko/20100101 Firefox/49.0','','','','','','','','','','<p>Test</p>','','',0,'245_245_1475130170.jpg','','','','','','','','<p>Test</p>','1','465_465_1475149400.jpg','http://www.google.com','','','<p>Test</p>',1,'','https://www.youtube.com/','','245_245_1475130170.jpg'),(6,39258,0,'','','','0000-00-00','0000-00-00',1000,0,0,'','','','','',0,'',0,'',0,'',0,'','','','','','',0,'2016-11-02','23.30.55.110','Mozilla/5.0 (Macintosh; Intel Mac OS X 10_10_5) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/54.0.2840.71 Safari/537.36','','','','','','','','','','<p>Preview Text,</p>','','',0,'245_245_1478118892.jpg','','','','','','','','<p>Offering Content</p>','0','','','','','<p>Investment Summary</p>',0,'','','<p>Team</p>','245_245_1478118892.jpg');
