INSERT INTO `99_offer_faqs` VALUES (2,90382,'','','2016-07-20 10:40:07',''),(3,50621,'What is TransactAPI?','<p class=\"p1\">TransactAPI is a transactional technology platform that enables broker-dealers, funding platforms, and issuers to conduct online private securities offerings. Our standards-based API toolkit can be quickly and easily integrated with proprietary platforms, saving development time and money. Issuers, intermediaries, and advisors can benefit from TAPI&rsquo;s straight through processing of private placement transactions, which enables higher transaction volumes, expands access to investors, and reduces processing times.</p>','2016-08-10 16:18:24',''),(4,50621,'How does syndication work?','<p class=\"p1\">Through our network of funding platforms and correspondent broker-dealers, NCPS can help you reach thousands of accredited investors including high net worth individuals, family offices, endowments, foundations, and other institutional investors.</p>','2016-08-10 16:18:24',''),(5,50621,'How can I contact NCPS?','<p class=\"p1\">Email info@norcapsecurities.com</p>','2016-08-10 16:18:24',''),(6,12045,'Have a question?','<p class=\"p1\">Contact info@mobilepineapple.com.</p>','2016-08-16 17:14:51',''),(7,7078,'','','2016-09-02 08:45:43',''),(11,22703,'','','2016-09-29 11:32:30',''),(12,39258,'','','2016-11-02 20:33:26','');
