INSERT INTO `99_team` VALUES ('245_mytext_245_14708459041.jpg','<p class=\"p1\">Jim Dowd is the Founder and Managing Director of North Capital. He was previously a Senior Managing Director at Bear Stearns from 2003 to 2008. Dowd has worked in New York, London, Tokyo and Hong Kong and has been involved in developing new financial services businesses for over 25 years. Dowd is a CFA charterholder and a CPA.</p>','2016-08-10 16:18:25',1,50621,'Jim Dowd','Founder and Managing Director'),('245_mytext_245_14708459052.jpg','<p class=\"p1\">Stephanie Holt is the Chief Financial Officer of North Capital. She has held senior finance positions in public and private technology companies for over 20 years.</p>','2016-08-10 16:18:25',2,50621,'Stephanie Holt','Chief Financial Officer'),('245_mytext_245_14708459053.jpg','<p class=\"p1\">Craig Goos is a Managing Director of North Capital. Goos was previously a Managing Director and Head of the Alternative Investments Group at UBS Wealth Management. Before UBS, Goos was a Managing Director at Bear Stearns. He has spent over fifteen years in the securities business, primarily in sales and product management of alternative investments.</p>','2016-08-10 16:18:25',3,50621,'Craig Goos','Managing Director'),('245_mytext_245_14713676911.jpg','<p class=\"p1\">John joined the Board of Directors in January 2010 and became Chairman in November 2012. In April 2013, he was appointed Chief Executive Officer of MobilePineapple. John has extensive experience in managing technology companies through their critical growth stages and utilizes his background to bring innovative ideas and products into the companies he manages. John has been advising companies on business strategy, restructuring and business development since 2005. During his career he held CFO, marketing and business development positions. Prior to turning to managerial roles John had several positions with investment funds in the US and Europe, focusing on high-tech investments. John holds a BA and MBA in Finance and Investments. In spite of his many duties, John likes to run and exercise, travel with his family to exotic places and initiate bridges between business people around the world.</p>','2016-08-16 17:14:52',4,12045,'John Julian','Chairman and Chief Executive Officer'),('245_mytext_245_14713676922.jpg','<p class=\"p1\">Chief Innovator of the MobilePineapple platform, Sam saw the need for an enterprise mobile solution that empowers those with the ideas to quickly and easily develop custom, native mobile apps themselves. Sam brings with him over 20 years of global technology experience from companies like IBM and Lenovo and is an accomplished thought leader in the adoption and commercialization of emerging technologies at the consumer and enterprise levels. Sam has a BS in Electrical Engineering from NC State, and an MBA from Duke University&rsquo;s Fuqua School of Business.</p>','2016-08-16 17:14:52',5,12045,'Sam Cardenas','President'),('245_mytext_245_14713676923.jpg','<p class=\"p1\">Geenah has been on the MobilePineapple team since October 2009 and currently oversees the Development and QA teams. She spent the first 11 years of her career at IBM where she honed skills in all facets of the Software Development Life Cycle. At MobilePineapple Geenah has put her process driven background to work by implementing a development process using the Agile Methodology. Geenah has a BS in Computer Information Systems from Appalachian State University and enjoys baking homemade treats for the company.</p>\r\n<p class=\"p2\">&nbsp;</p>','2016-08-16 17:14:52',6,12045,'Geenah Schaus','Development Manager');
/*!40000 ALTER TABLE `99_team` ENABLE KEYS */;
UNLOCK TABLES;

